- input: "TEXT\x1CC00348540\x1C.TEXT\x1C\x1CF3XA\x1CDear Mr. Morse:  In response to
    your March 9, 2011 letter, the 1199 Service Employees Int'l Union Federal Political
    Action Fund (the 'Committee') responds as follows:                                                                                                                        1.
    \ The $324,426.87 Calendar Year-to-Date Per Election for Office Sought total originally
    reported for an independent on behalf of Mac D'Alessandro reflected an administrative
    error:  that total over-reported payments against debts totalling $74,528.47 by
    counting them both when the debts were incurred and when the payments were made.
    \                                                                                                 2.
    \ The 10/29/2010 payment of $20,000 to Majority Action reflected an additional
    payment made after receiving an adjusted bill for an independent expenditure already
    reported on 10/14/2010 for                                                                              $150,000.
    \                                                                                                               The
    Committee continues to make every effort to properly comply with Federal election
    law and regulations.  Please do not hesitate to contact us if you should require
    more information.  Thank you.\n"
