    value: 'Dear Mr. Morse:  In response to your March 9, 2011 letter, the 1199 Service
      Employees Int''l Union Federal Political Action Fund (the ''Committee'') responds
      as follows:                                                                                                                        1.  The
      $324,426.87 Calendar Year-to-Date Per Election for Office Sought total originally
