      error:  that total over-reported payments against debts totalling $74,528.47
      by counting them both when the debts were incurred and when the payments were
      made.                                                                                                  2.  The
      10/29/2010 payment of $20,000 to Majority Action reflected an additional payment
      made after receiving an adjusted bill for an independent expenditure already
      reported on 10/14/2010 for                                                                              $150,000.                                                                                                                The
